import{_ as t,c as e,o as l,a5 as d}from"./chunks/framework.CqnjdYks.js";const r="/docs/cocos/assets/menu.j8-bckQZ.png",a="/docs/cocos/assets/file.DQLekiMg.png",s="/docs/cocos/assets/edit.a6YLRgPM.png",n="/docs/cocos/assets/node.4KL1qW1A.png",o="/docs/cocos/assets/project.IPEYsRgv.png",g="/docs/cocos/assets/panel.CFI6A4lz.png",i="/docs/cocos/assets/extension.Zku7FnbU.png",f="/docs/cocos/assets/developer.B9-MKc5w.png",b="/docs/cocos/assets/help.Dgi1rWMy.png",q=JSON.parse('{"title":"主菜单","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/editor/mainMenu/index.md","filePath":"zh/manual/editor/mainMenu/index.md"}'),h={name:"zh/manual/editor/mainMenu/index.md"},x=d('<h1 id="主菜单" tabindex="-1">主菜单 <a class="header-anchor" href="#主菜单" aria-label="Permalink to &quot;主菜单&quot;">​</a></h1><p>Cocos Creator 顶部的主菜单栏中包括 <strong>文件</strong>、<strong>编辑</strong>、<strong>节点</strong>、<strong>项目</strong>、<strong>面板</strong>、<strong>扩展</strong>、<strong>开发者</strong> 和 <strong>帮助</strong> 8 个菜单项，集成了 Cocos Creator 大部分的功能点。</p><p><img src="'+r+'" alt="menu"></p><h2 id="文件" tabindex="-1">文件 <a class="header-anchor" href="#文件" aria-label="Permalink to &quot;文件&quot;">​</a></h2><p>该项主要用于项目或场景的新建、打开、保存等操作，以及导入 Cocos Creator 2.x 项目。</p><p><img src="'+a+'" alt="file"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">新建项目</td><td style="text-align:left;">打开 Dashboard 的 <a href="./../../getting-started/dashboard/#项目">项目</a> 分页，以新建一个项目。若使用的 Dashboard 版本是 v1.0.19，则会打开 Dashboard 的 <a href="./../../getting-started/dashboard/#新建项目">新建项目</a> 分页</td></tr><tr><td style="text-align:left;">打开项目</td><td style="text-align:left;">打开 Dashboard 的 <a href="./../../getting-started/dashboard/#项目">项目</a> 分页</td></tr><tr><td style="text-align:left;">新建场景（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>N</kbd>）</td><td style="text-align:left;">关闭当前场景并创建一个新场景，新创建的场景需要手动保存才会添加到项目目录下</td></tr><tr><td style="text-align:left;">保存场景（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd>）</td><td style="text-align:left;">保存当前正在编辑的场景，如果是使用 <strong>文件 -&gt; 新建场景</strong> 创建的场景，在第一次保存时会弹出对话框，需要选择场景文件保存的位置并填写文件名，然后点击 <strong>保存</strong> 即可。场景文件以 <code>.scene</code> 作为扩展名</td></tr><tr><td style="text-align:left;">另存为（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> +<kbd>Shift</kbd>+ <kbd>S</kbd>）</td><td style="text-align:left;">生成当前场景文件的副本，并保存在项目中</td></tr><tr><td style="text-align:left;">偏好设置</td><td style="text-align:left;">打开 <a href="./../preferences/">偏好设置</a> 面板，对编辑器进行个性化设置</td></tr><tr><td style="text-align:left;">布局</td><td style="text-align:left;">设置编辑器界面布局，通过二级菜单可以保存当前局部至 <strong>自定义布局</strong></td></tr><tr><td style="text-align:left;">快捷键</td><td style="text-align:left;">打开快捷键设置面板，查看编辑器各面板或功能模块默认使用的快捷键，支持自定义</td></tr><tr><td style="text-align:left;">导入 Cocos Creator 2.x 项目</td><td style="text-align:left;">v2.x 资源导入工具，支持旧项目资源完美导入，以及代码的辅助迁移。详情请参考 <a href="./../../release-notes/upgrade-guide-v3.0.html">v3.0 升级指南</a></td></tr><tr><td style="text-align:left;">关闭窗口（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>W</kbd>）</td><td style="text-align:left;">关闭当前窗口</td></tr><tr><td style="text-align:left;">退出</td><td style="text-align:left;">关闭当前编辑器，并自动打开 Dashboard</td></tr></tbody></table><h2 id="编辑" tabindex="-1">编辑 <a class="header-anchor" href="#编辑" aria-label="Permalink to &quot;编辑&quot;">​</a></h2><p>该项主要包括撤销、重做、复制和粘贴等常用编辑功能。</p><p><img src="'+s+'" alt="edit"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th><th style="text-align:left;">默认快捷键</th></tr></thead><tbody><tr><td style="text-align:left;">撤销</td><td style="text-align:left;">撤销上一次对场景的修改</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Z</kbd></td></tr><tr><td style="text-align:left;">重做</td><td style="text-align:left;">恢复上一步骤的撤销动作</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>Z</kbd></td></tr><tr><td style="text-align:left;">剪切</td><td style="text-align:left;">剪切当前选中的节点或字符到剪贴板</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>X</kbd></td></tr><tr><td style="text-align:left;">复制</td><td style="text-align:left;">复制当前选中的节点或字符到剪贴板</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>C</kbd></td></tr><tr><td style="text-align:left;">粘贴</td><td style="text-align:left;">将剪贴板中的内容粘贴到相应的位置</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>V</kbd></td></tr><tr><td style="text-align:left;">全选</td><td style="text-align:left;">焦点在层级管理器内为选中同一层级中的所有节点，焦点在资源管理器则选中同一层级中的所有资源</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>A</kbd></td></tr></tbody></table><blockquote><p><strong>注意</strong>：节点的 <strong>复制</strong>、<strong>剪切</strong> 和 <strong>粘贴</strong> 请使用快捷键进行操作。</p></blockquote><h2 id="节点" tabindex="-1">节点 <a class="header-anchor" href="#节点" aria-label="Permalink to &quot;节点&quot;">​</a></h2><p>该项包含调整视角、取消关联预制节点和创建节点等功能。</p><p><img src="'+n+'" alt="node"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">视角对齐（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>F</kbd>）</td><td style="text-align:left;">将当前选中节点移动到 <strong>场景编辑器</strong> 的视角中心</td></tr><tr><td style="text-align:left;">将视角和节点对齐</td><td style="text-align:left;">将 <strong>场景编辑器</strong> 中的视角设置为以当前选中节点为中心</td></tr><tr><td style="text-align:left;">取消关联当前的 Prefab 资源</td><td style="text-align:left;">用于将选中的预制节点转化成普通节点，详情请参考 <a href="./../../asset/prefab.html">Prefab</a></td></tr><tr><td style="text-align:left;">递归地取消关联当前的 Prefab 资源</td><td style="text-align:left;">用于将场景中包含嵌套的预制节点递归地转化为普通节点，详情请参考 <a href="./../../asset/prefab.html">Prefab</a></td></tr><tr><td style="text-align:left;">空节点</td><td style="text-align:left;">在场景中创建一个空节点，如果执行命令前场景中已经选中了节点，新建的节点会成为选中节点的子节点</td></tr><tr><td style="text-align:left;">3D 对象</td><td style="text-align:left;">Creator 提供了一些比较基础的静态模型控件以便使用，目前包括 <strong>立方体</strong>、<strong>圆柱体</strong>、<strong>球体</strong>、<strong>胶囊</strong>、<strong>圆锥体</strong>、<strong>圆环体</strong>、<strong>平面</strong> 和 <strong>四方形</strong>。若需要创建其他类型的模型，可参考 <a href="./../../engine/renderable/model-component.html">MeshRenderer 组件</a></td></tr><tr><td style="text-align:left;">2D 对象</td><td style="text-align:left;">在场景中创建 Creator 预设好的包含基础渲染组件的 2D 节点，目前包括 <strong>Graphics</strong>（绘图）、<strong>Label</strong>（文本）、<strong>Mask</strong>（遮罩）、<strong>ParticleSystem2D</strong>（粒子）、<strong>Sprite</strong>（精灵）、<strong>SpriteSplash</strong>（单色）和 <strong>TiledMap</strong>（地图），详细情况可参考 <a href="./../../ui-system/components/editor/render-component.html">2D 渲染组件介绍</a></td></tr><tr><td style="text-align:left;">UI 组件</td><td style="text-align:left;">在场景中创建 Creator 预设好的包含基础 UI 组件的节点，目前包括 <strong>Button</strong>（按钮）、<strong>Widget</strong>（对齐挂件）、<strong>Layout</strong>（布局）、<strong>ScrollView</strong>（滚动视图）、<strong>EditBox</strong>（输入框）等节点在内的常用 UI 控件。更多 UI 组件介绍，可以查看 <a href="./../../ui-system/components/editor/base-component.html">UI 基础组件</a></td></tr><tr><td style="text-align:left;">光线</td><td style="text-align:left;">在场景中创建 Creator 预设好的包含基础光源组件的节点，目前包括 <strong>平行光</strong>、<strong>球面光</strong>、<strong>聚光</strong> 以及 <strong>光照探针</strong> 和 <strong>反射探针</strong>，详情请参考 <a href="./../../concepts/scene/light.html">光照</a></td></tr><tr><td style="text-align:left;">特效</td><td style="text-align:left;">在场景中创建 Creator 预设好的包含 <a href="./../../particle-system/overview.html">粒子系统</a> 组件的节点。更多特效组件可在 <strong>属性检查器</strong> 面板点击 <strong>添加组件 -&gt; 特效</strong> 进行添加。</td></tr><tr><td style="text-align:left;">摄像机</td><td style="text-align:left;">在场景中创建 Creator 预设好的包含 Camera 组件的节点。具体的使用方式，详情请参考 <a href="./../components/camera-component.html">Camera 组件</a></td></tr><tr><td style="text-align:left;">地形</td><td style="text-align:left;">在场景中创建 Creator 预设好的包含地形组件的节点。具体的使用方式，详情请参考 <a href="./../terrain/">地形系统</a></td></tr></tbody></table><h2 id="项目" tabindex="-1">项目 <a class="header-anchor" href="#项目" aria-label="Permalink to &quot;项目&quot;">​</a></h2><p>该项主要用于执行预览运行构建项目、项目配置和自定义构建等。</p><p><img src="'+o+'" alt="project"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">项目设置</td><td style="text-align:left;">打开 <a href="./../project/">项目设置</a> 面板，设置特定项目的相关配置项</td></tr><tr><td style="text-align:left;">光照贴图</td><td style="text-align:left;">打开 <a href="./../../concepts/scene/light/lightmap.html">光照贴图</a> 面板，配置生成光照贴图的烘焙参数</td></tr><tr><td style="text-align:left;">运行预览（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>P</kbd>）</td><td style="text-align:left;">点击该项即可在选择的浏览器/模拟器中预览项目效果，详情请参考 <a href="./../preview/">预览调试</a></td></tr><tr><td style="text-align:left;">刷新预览（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>P</kbd>）</td><td style="text-align:left;">刷新已经打开的浏览器预览窗口</td></tr><tr><td style="text-align:left;">生成预览模板</td><td style="text-align:left;">该项用于自定义想要的预览效果，详情请参考 <a href="./../preview/browser.html">自定义预览模板</a></td></tr><tr><td style="text-align:left;">构建发布（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>B</kbd>）</td><td style="text-align:left;">打开 <a href="./../publish/">构建发布</a> 面板，将游戏打包发布到目标平台上</td></tr><tr><td style="text-align:left;">构建项目构建模板</td><td style="text-align:left;">该项用于定制项目的构建模板，详情请参考 <a href="./../publish/custom-project-build-template.html">自定义构建模板</a></td></tr><tr><td style="text-align:left;">新建构建扩展包</td><td style="text-align:left;">该项用于自定义构建流程，详情请参考文档 <a href="./../publish/custom-build-plugin.html">自定义构建流程</a></td></tr></tbody></table><h2 id="面板" tabindex="-1">面板 <a class="header-anchor" href="#面板" aria-label="Permalink to &quot;面板&quot;">​</a></h2><p>该项主要用于打开编辑器中的各式面板。</p><p><img src="'+g+'" alt="panel"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th><th style="text-align:left;">默认快捷键</th></tr></thead><tbody><tr><td style="text-align:left;">控制台</td><td style="text-align:left;">打开 <a href="./../console/">控制台</a>，用于查看输出的日志信息</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>0</kbd></td></tr><tr><td style="text-align:left;">场景编辑器</td><td style="text-align:left;">打开 <a href="./../scene/">场景编辑器</a> 面板。用于选择和摆放场景图像、角色、特效、UI 等各类游戏元素</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>1</kbd></td></tr><tr><td style="text-align:left;">资源管理器</td><td style="text-align:left;">打开 <strong>资源管理器</strong>/<strong>资源预览</strong> 面板，用于访问/管理/查看项目资源，详情请参考 <a href="./../assets/">资源管理器</a></td><td style="text-align:left;">资源管理器为 <kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>2</kbd></td></tr><tr><td style="text-align:left;">属性检查器</td><td style="text-align:left;">打开 <a href="./../inspector/">属性检查器</a> 面板，用于查看并编辑当前选中节点、节点组件和资源的工作区域</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>3</kbd></td></tr><tr><td style="text-align:left;">层级管理器</td><td style="text-align:left;">打开 <a href="./../hierarchy/">层级管理器</a> 面板，该面板以树状列表的形式展示了场景中所有节点之间的层级关系</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>4</kbd></td></tr><tr><td style="text-align:left;">预览</td><td style="text-align:left;">打开 <strong>摄像机预览</strong> 面板，该面板展示的画面与在场景中选中对应 Camera 节点时，<strong>场景编辑器</strong> 右下角展示的画面一致。当调整场景时，摄像机预览面板中的画面也会实时同步</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>5</kbd></td></tr><tr><td style="text-align:left;">动画</td><td style="text-align:left;">可以打开 <a href="./../../animation/">动画编辑器</a> 面板或者 <a href="./../../animation/joint-texture-layout.html">Joint Texture Layout（骨骼贴图布局）</a> 面板，用于对帧动画或者骨骼动画进行编辑、查看等功能</td><td style="text-align:left;">动画编辑器为 <kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>6</kbd></td></tr><tr><td style="text-align:left;">节点预制库</td><td style="text-align:left;">打开节点预制库面板。该面板是一个非常简单直接的可视化控件仓库，开发者可以将这里列出的控件拖拽到 <strong>场景编辑器</strong> 或 <strong>层级管理器</strong> 中，快速完成预设控件的创建</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>7</kbd></td></tr><tr><td style="text-align:left;">服务</td><td style="text-align:left;">打开 <a href="https://service.cocos.com/document/zh" target="_blank" rel="noreferrer">服务</a> 面板，该面板提供了一些优质的官方以及第三方服务，方便开发者获得更多引擎之外的扩展能力，让游戏开发工作变得更加简单</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>8</kbd></td></tr><tr><td style="text-align:left;">扩展示例</td><td style="text-align:left;">可以打开一个默认的扩展示例</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">Cocos 小秘书</td><td style="text-align:left;">打开 <a href="https://www.cocos.com/assistant" target="_blank" rel="noreferrer">Cocos 小秘书</a> 面板，该面板与 Cocos Creator 编辑器紧密结合，⽆缝嵌⼊开发环境，⽆论开发者遇到任何问题，随时可以向官方技术人员发起交流。目前仅支持 Creator 中文版</td><td style="text-align:left;"></td></tr></tbody></table><h2 id="扩展" tabindex="-1">扩展 <a class="header-anchor" href="#扩展" aria-label="Permalink to &quot;扩展&quot;">​</a></h2><p>该项主要包括扩展管理器、商城和创建扩展等，详情请参考 <a href="./../extension/readme.html">编辑器扩展</a> 一章。</p><p><img src="'+i+'" alt="extension"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">扩展管理器</td><td style="text-align:left;">打开 <strong>扩展管理器</strong> 面板，其中包括了编辑器内置扩展、项目目录及全局目录下安装的扩展，详情请参考 <a href="./../extension/readme.html">编辑器扩展</a></td></tr><tr><td style="text-align:left;">商城</td><td style="text-align:left;">点击该项即可进入 Cocos Creator 内置的 <a href="https://store.cocos.com/app/" target="_blank" rel="noreferrer">扩展商城</a>，可供用户浏览、下载和自动安装官方或者第三方扩展和资源。同时用户也可以将自己开发的扩展插件、美术素材、音乐音效等资源提交到扩展商店以便分享或者售卖。详情请参考 <a href="./../extension/store/upload-store.html">提交资源到商店</a></td></tr><tr><td style="text-align:left;">创建扩展</td><td style="text-align:left;">该项用于在项目/全局目录下生成一个 <a href="./../extension/first.html">扩展包</a>，以便对编辑器进行功能扩展</td></tr></tbody></table><h2 id="开发者" tabindex="-1">开发者 <a class="header-anchor" href="#开发者" aria-label="Permalink to &quot;开发者&quot;">​</a></h2><p>该项主要包含脚本、引擎和调试工具等开发相关的菜单功能。</p><p><img src="'+f+'" alt="developer"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">编译引擎（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>F7</kbd>）</td><td style="text-align:left;">编译自定义引擎，详情请参考 <a href="./../../advanced-topics/engine-customization.html">引擎定制工作流程</a></td></tr><tr><td style="text-align:left;">编译原生模拟器引擎</td><td style="text-align:left;">编译自定义原生引擎模拟器，详情请参考 <a href="./../../advanced-topics/engine-customization.html#25-定制原生引擎模拟器">定制原生模拟器引擎</a></td></tr><tr><td style="text-align:left;">消息调试工具</td><td style="text-align:left;">打开消息调试工具，用于调试编辑器内部运行时的 IPC 交互</td></tr><tr><td style="text-align:left;">Tester</td><td style="text-align:left;">编辑器内置扩展的测试工具，目前暂未开放全部功能</td></tr><tr><td style="text-align:left;">开关图形工具</td><td style="text-align:left;">开/关图形工具面板，用于调试场景渲染</td></tr><tr><td style="text-align:left;">消息列表</td><td style="text-align:left;">打开 <a href="./../extension/contributions-messages.html">消息管理器</a> 面板，用于显示编辑器每个功能定义的公开消息及其说明</td></tr><tr><td style="text-align:left;">Export.d.ts</td><td style="text-align:left;">导出编辑器相关的 API</td></tr><tr><td style="text-align:left;">重新加载（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>R</kbd>）</td><td style="text-align:left;">重新加载编辑器界面</td></tr><tr><td style="text-align:left;">UI 组件</td><td style="text-align:left;">打开 UI 组件面板，该面板列举了编辑器内提供的预设 UI 组件的使用方式，详情请参考 <a href="./../extension/ui.html">UI 组件</a></td></tr><tr><td style="text-align:left;">缓存</td><td style="text-align:left;">该项中的 <strong>清除代码缓存</strong> 用于清除脚本编译时产生的缓存</td></tr><tr><td style="text-align:left;">VS Code Workflow</td><td style="text-align:left;">VS Code 代码编辑器的工作环境相关功能，目前支持 <strong>添加 Chrome debug 配置</strong> 和 <strong>添加编译任务</strong>，详情请参考 <a href="./../../scripting/coding-setup.html">配置代码编辑环境</a>。</td></tr><tr><td style="text-align:left;">开关开发人员工具（<kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>I</kbd>）</td><td style="text-align:left;">开/关开发者工具窗口，用于编辑器界面扩展的开发。同时也可以自定义输出到 <strong>控制台</strong> 的日志，详情请参考 <a href="./../console/#自定义输出信息">自定义输出消息</a></td></tr><tr><td style="text-align:left;">打开资源调试工具</td><td style="text-align:left;">打开资源调试面板，用于查看修改 asset-db 进程期间的日志消息</td></tr><tr><td style="text-align:left;">打开场景调试工具</td><td style="text-align:left;">打开场景调试面板，用于查看修改场景时的日志消息</td></tr><tr><td style="text-align:left;">打开构建调试工具</td><td style="text-align:left;">打开构建调试工具，用于查看在构建过程中产生的全部日志信息包括调用栈</td></tr></tbody></table><h2 id="帮助" tabindex="-1">帮助 <a class="header-anchor" href="#帮助" aria-label="Permalink to &quot;帮助&quot;">​</a></h2><p><img src="'+b+'" alt="help"></p><table><thead><tr><th style="text-align:left;">选项</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">使用手册</td><td style="text-align:left;">在默认浏览器打开 <a href="./../../">用户手册文档</a></td></tr><tr><td style="text-align:left;">API 文档</td><td style="text-align:left;">在默认浏览器打开 <a href="./__APIDOC__/zh.html">API 参考文档</a></td></tr><tr><td style="text-align:left;">论坛</td><td style="text-align:left;">在默认浏览器打开 <a href="https://forum.cocos.org/c/58" target="_blank" rel="noreferrer">Cocos Creator 论坛</a></td></tr><tr><td style="text-align:left;">软件许可</td><td style="text-align:left;">可以查看 Cocos Creator 的软件许可信息</td></tr><tr><td style="text-align:left;">更新日志</td><td style="text-align:left;">在默认浏览器打开 Cocos Creator 各版本的 <a href="https://www.cocos.com/creator" target="_blank" rel="noreferrer">更新日志</a></td></tr><tr><td style="text-align:left;">引擎仓库</td><td style="text-align:left;">在默认浏览器打开 <a href="https://github.com/cocos/cocos-engine" target="_blank" rel="noreferrer">TypeScript 引擎仓库</a></td></tr><tr><td style="text-align:left;">关于 Cocos Creator</td><td style="text-align:left;">显示 Cocos Creator 相关版本号以及版权信息</td></tr></tbody></table>',35),y=[x];function k(c,m,p,C,u,_){return l(),e("div",null,y)}const S=t(h,[["render",k]]);export{q as __pageData,S as default};
